<div class="cell border-box-sizing text_cell rendered">
<div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<ul>
<li>名付けとは関係ないが、アメリカ合衆国の出生数の推移が分かる。</li>
<li>1930〜1940年代、1970年代になぜ出生数が落ちているのか疑問だったが、むしろ1920年代、1940〜1960年代が<a href="http://ja.wikipedia.org/wiki/%E3%83%99%E3%83%93%E3%83%BC%E3%83%96%E3%83%BC%E3%83%A0">ベビーブーム</a>だったということらしい。</li>
</ul>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered">
<div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h5 id="&#20986;&#29983;&#25968;&#27604;&#29575;&#12398;&#21015;&#12434;&#36861;&#21152;&#12377;&#12427;">&#20986;&#29983;&#25968;&#27604;&#29575;&#12398;&#21015;&#12434;&#36861;&#21152;&#12377;&#12427;<a class="anchor-link" href="#&#20986;&#29983;&#25968;&#27604;&#29575;&#12398;&#21015;&#12434;&#36861;&#21152;&#12377;&#12427;">&#182;</a></h5>
</div>
</div>
</div>

<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">
In&nbsp;[14]:
</div>
<div class="inner_cell">
    <div class="input_area">
<div class="highlight"><pre><span class="k">def</span> <span class="nf">add_prop</span><span class="p">(</span><span class="n">group</span><span class="p">):</span>
    <span class="c"># integer同士の除算は繰り上げ(floor)されてしまうためfloatにキャスト</span>
    <span class="n">births</span> <span class="o">=</span> <span class="n">group</span><span class="o">.</span><span class="n">births</span><span class="o">.</span><span class="n">astype</span><span class="p">(</span><span class="nb">float</span><span class="p">)</span>
    
    <span class="n">group</span><span class="p">[</span><span class="s">&#39;prop&#39;</span><span class="p">]</span> <span class="o">=</span> <span class="n">births</span> <span class="o">/</span> <span class="n">births</span><span class="o">.</span><span class="n">sum</span><span class="p">()</span>
    
    <span class="k">return</span> <span class="n">group</span>

<span class="n">names</span> <span class="o">=</span> <span class="n">names</span><span class="o">.</span><span class="n">groupby</span><span class="p">([</span><span class="s">&#39;year&#39;</span><span class="p">,</span> <span class="s">&#39;sex&#39;</span><span class="p">])</span><span class="o">.</span><span class="n">apply</span><span class="p">(</span><span class="n">add_prop</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered">
<div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<ul>
<li>add_propはDataFrameオブジェクトを引数とする関数。</li>
<li>DataFrameGroupByオブジェクトのapplyは、各グループに関数を適用し、その結果を集約して返す。</li>
</ul>
</div>
</div>
</div>
