</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h4 id="2.3.1.1-&#22810;&#27096;&#21270;&#12375;&#12390;&#12356;&#12367;&#21517;&#20184;&#12369;">2.3.1.1 &#22810;&#27096;&#21270;&#12375;&#12390;&#12356;&#12367;&#21517;&#20184;&#12369;<a class="anchor-link" href="#2.3.1.1-&#22810;&#27096;&#21270;&#12375;&#12390;&#12356;&#12367;&#21517;&#20184;&#12369;">&#182;</a></h4>
</div>
</div>
</div>

<div class="cell border-box-sizing text_cell rendered">
<div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>多様性を表す指標として、次の2つを考える。</p>
<ol style="list-style-type: decimal">
<li>上位1000件の名前が全体に占める割合</li>
<li>上位50%を占める名前の件数</li>
</ol>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered">
<div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h5 id="(1)&#12288;&#19978;&#20301;1000&#20214;&#12398;&#21517;&#21069;&#12364;&#20840;&#20307;&#12395;&#21344;&#12417;&#12427;&#21106;&#21512;">(1)&#12288;&#19978;&#20301;1000&#20214;&#12398;&#21517;&#21069;&#12364;&#20840;&#20307;&#12395;&#21344;&#12417;&#12427;&#21106;&#21512;<a class="anchor-link" href="#(1)&#12288;&#19978;&#20301;1000&#20214;&#12398;&#21517;&#21069;&#12364;&#20840;&#20307;&#12395;&#21344;&#12417;&#12427;&#21106;&#21512;">&#182;</a></h5>
</div>
</div>
</div>

<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">
In&nbsp;[27]:
</div>
<div class="inner_cell">
    <div class="input_area">
<div class="highlight"><pre><span class="n">table</span> <span class="o">=</span> <span class="n">top1000</span><span class="o">.</span><span class="n">pivot_table</span><span class="p">(</span><span class="s">&#39;prop&#39;</span><span class="p">,</span> <span class="n">rows</span><span class="o">=</span><span class="s">&#39;year&#39;</span><span class="p">,</span>
                            <span class="n">cols</span><span class="o">=</span><span class="s">&#39;sex&#39;</span><span class="p">,</span> <span class="n">aggfunc</span><span class="o">=</span><span class="nb">sum</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">
In&nbsp;[28]:
</div>
<div class="inner_cell">
    <div class="input_area">
