    <span class="n">group</span> <span class="o">=</span> <span class="n">group</span><span class="o">.</span><span class="n">sort_index</span><span class="p">(</span><span class="n">by</span><span class="o">=</span><span class="s">&#39;prop&#39;</span><span class="p">,</span> <span class="n">ascending</span><span class="o">=</span><span class="bp">False</span><span class="p">)</span>
    <span class="k">return</span> <span class="n">group</span><span class="o">.</span><span class="n">prop</span><span class="o">.</span><span class="n">cumsum</span><span class="p">()</span><span class="o">.</span><span class="n">values</span><span class="o">.</span><span class="n">searchsorted</span><span class="p">(</span><span class="n">q</span><span class="p">)</span> <span class="o">+</span> <span class="mi">1</span>

<span class="n">diversity_tmp</span> <span class="o">=</span> <span class="n">top1000</span><span class="o">.</span><span class="n">groupby</span><span class="p">([</span><span class="s">&#39;year&#39;</span><span class="p">,</span> <span class="s">&#39;sex&#39;</span><span class="p">])</span><span class="o">.</span><span class="n">apply</span><span class="p">(</span><span class="n">get_quantile_count</span><span class="p">)</span>
<span class="n">diversity</span> <span class="o">=</span> <span class="n">diversity_tmp</span><span class="o">.</span><span class="n">unstack</span><span class="p">(</span><span class="s">&#39;sex&#39;</span><span class="p">)</span>
