<div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<ul>
<li>quantileは、統計用語で、分位数、分位点、分位値などと訳される。中央値、四分位数等の総称。</li>
<li>get_quantile_countは、出生数の中央に位置する名前そのものではなく、その名前の順位を返す。</li>
<li>diversityは、多様性。</li>
<li>ここでのapplyの結果は、グループごとの上位50%を占める名前件数から成るSeriesになる。</li>
<li>Series.unstackは、マルチインデックスのSeriesをDataFrameに変換する。<br /> ここでは、applyが返すSeriesが年代と性別でインデックス付けされているので、<br /> 年代を行の、性別を列のインデックスとするDataFrameが得られる。</li>
</ul>
</div>
</div>
</div>
