<div class="highlight"><pre><span class="n">diversity</span><span class="o">.</span><span class="n">plot</span><span class="p">(</span><span class="n">title</span><span class="o">=</span><span class="s">&quot;Number of popular names in top 50%&quot;</span><span class="p">)</span>
</pre></div>

